sera.pxf.io/MXYqaN\n\nUdemy Courses:\nPython for Data Analysis and Visualization- https://bit.ly/3hhX4LX\nStatistics for Data Science - https://bit.ly/37jqDbq\nSQL for Data Analysts (SSMS) - https://bit.ly/3fkqEij\nTableau A-Z - http://bit.ly/385lYvN\n\nPlease note I may earn a small commission for any purchase through these links - Thanks for supporting the channel!\n____________________________________________ \n\nSUPPORT MY CHANNEL - PATREON/MERCH\n\nPatreon Page -   / alextheanalyst  \n\nAlex The Analyst Shop - https://teespring.com/stores/alex-the...\n\n____________________________________________ \n\nWebsites: \nGitHub: https://github.com/AlexTheAnalyst\n____________________________________________\n\nAll opinions or statements in this video are my own and do not reflect the opinion of the company I work for or have ever worked for\n\n0:00 Introduction\n1:43 Getting Out Dataset\n6:41 Importing Datasets into SQL\n13:40 Data Exploration\n1:13:35 Import Code into GitHub","commandRuns":[{"startIndex":32,"length":22,"onTap":{"innertubeCommand":{"clickTrackingParams":"CKUDEM2rARgBIhMIi8nmtou9iAMVTyoGAB1mcQQpSMP1lILH06z-qQE=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbElzTVBnZXhzdnc3T3Q4NWlqNjV3bkFIcGhCd3xBQ3Jtc0tsUXl0UUdfcC1IR2dwYkpMSG9OeUZRckpReVdqSG03VnpoS281RnNaZjBjZFNJMjd3TWlQZlVsREl5S3FlT2tEQWg4UjZ4emZaSzFpMWViSUNabmdHUTZEQWhkcEZQbkYzOFNpTWFUR3lDQlJlTmQ2bw\u0026q=https%3A%2F%2Fbit.ly%2F3tqOipr\u0026v=qfyynHBFOsM","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbElzTVBnZXhzdnc3T3Q4NWlqNjV3bkFIcGhCd3xBQ3Jtc0tsUXl0UUdfcC1IR2dwYkpMSG9OeUZRckpReVdqSG03VnpoS281RnNaZjBjZFNJMjd3TWlQZlVsREl5S3FlT2tEQWg4UjZ4emZaSzFpMWViSUNabmdHUTZEQWhkcEZQbkYzOFNpTWFUR3lDQlJlTmQ2bw\u0026q=https%3A%2F%2Fbit.ly%2F3tqOipr\u0026v=qfyynHBFOsM","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"sta