 career or even switch your career into Data Analytics. Be sure to subscribe to not miss out on any content!\n____________________________________________ \n\nRESOURCES:\n\nCoursera Courses:\nGoogle Data Analyst Certification: https://coursera.pxf.io/5bBd62\nData Analysis with Python - https://coursera.pxf.io/BXY3Wy\nIBM Data Analysis Specialization - https://coursera.pxf.io/AoYOdR\nTableau Data Visualization - https://coursera.pxf.io/MXYqaN\n\nUdemy Courses:\nPython for Data Analysis and Visualization- https://bit.ly/3hhX4LX\nStatistics for Data Science - https://bit.ly/37jqDbq\nSQL for Data Analysts (SSMS) - https://bit.ly/3fkqEij\nTableau A-Z - http://bit.ly/385lYvN\n\nPlease note I may earn a small commission for any purchase through these links - Thanks for supporting the channel!\n____________________________________________ \n\nSUPPORT MY CHANNEL - PATREON/MERCH\n\nPatreon Page -   / alextheanalyst  \n\nAlex The Analyst Shop - https://teespring.com/stores/alex-the...\n\n____________________________________________ \n\nWebsites: \nGitHub: https://github.com/AlexTheAnalyst\n____________________________________________\n\nAll opinions or statements in this video are my own and do not reflect the opinion of the company I work for or have ever worked for\n\n0:00 Introduction\n1:43 Getting Out Dataset\n6:41 Importing Datasets into SQL\n13:40 Data Exploration\n1:13:35 Import Code into GitHub","commandRuns":[{"startIndex":32,"length":22,"onTap":{"innertubeCommand":{"clickTrackingParams":"CB0Q040EGAciEwiLyea2i72IAxVPKgYAHWZxBClIw_WUgsfTrP6pAQ==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqazNhRjlid3BsSVpjSURKMmtiTnhoT3p2ZFVDd3xBQ3Jtc0ttV25qYmYtX1NxUm01S1BuXzliN0pRaFBFamNzV1JWT1AwM0R3TTF1UTVjNGQ4dkFha2R1M0FFUU81Y1M4cWtWczJRaUNyaHBzVzVUQ09paHBKY0gzd1NTZDZKMlhBVGR6RHhYMHVEU2I0NENCLXBvWQ\u0026q=https%3A%2F%2Fbit.ly%2F3tqOipr\u0026v=qfyynHBFOsM","webPageType":"WEB_PAGE_TYPE_UNKNOWN","root